import React from 'react';
import { BrowserRouter as Router,Switch,Route } from "react-router-dom";
import './App.css';
import HomePage from './Profiles/HomePage';

function App() {
  const user=null;
  return (
    <div className="app">
      <Router>
        <Switch>
        {!user?
          <Route exact path="/">
            <HomePage />
          </Route>
            :
          <Route path="/test">
            <h1>Test</h1>
          </Route>
        } 
        </Switch>
    </Router>
    </div>
  );
}

export default App;
